value.value:
x -> {
    if ($x.size() > 1,
        zipArchive(
            name: "download.zip", 
            // Sort entries to make contents reproducible.
            entries: $x.sort(comparator(entry -> $entry.get(`test.binarycontent:A#name`))).map(entry -> {
                data = $entry.get(`test.binarycontent:A#data`);
                zipEntry(
                    // Set time to make contents reproducible.
                    time: 0, 
                    contents: binary(
                        name: $entry.get(`test.binarycontent:A#name`) + "/" + toString($data),
                        data: $data
                    )
                )
            })
        ),
        $x.singleElement().get(`test.binarycontent:A#data`)
    )
}
